import React from "react";
import "./css/EditPrisoner.css";

class EditPrisoner extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    // const id = this.props.params
    console.log(this.props.params.id)
    // this.props.getPrisonerInfo(id);
  }

  render() {
    return (
      <div
        to={`/employer/prisoner/edit/${this.props.id}`}
        className="prisoner-wrapper"
      >
        <div className="summary-info">
          <div className="header">
            <h3>{this.props.name}</h3>
            <p>
              {this.props.availability === 1
                ? "Avaiable"
                : "Currently Unavailable"}
            </p>
          </div>
          <p>{this.props.skills}</p>
        </div>

        <div>
          <img src={this.props.picture} alt="profile" />
          <p>{this.props.profile}</p>
        </div>
      </div>
    );
  }
}

export default EditPrisoner;
